@Override
protected Point[] nextShape() {
  int n = random().nextInt(4) + 1;
  Point[] points = new Point[n];
  for (int i =0; i < n; i++) {
    points[i] = new Point(GeoTestUtil.nextLatitude(), GeoTestUtil.nextLongitude());
  }
  return points;
}

